import horse from "./reactImages/svg/horse.svg";

interface Props {
  type: string;
}

const svgMap: any = {
  bird,
  cat,
  cow,
  dog,
  gator,
  horse,
};

function AnimalShow(props: Props) {
  const handleClick = () => {};

  const { type } = props;
  return (
    <div onClick={handleClick}>
      <img alt="animal" src={svgMap[type]} />
    </div>
  );
}

export default AnimalShow;
